  getBooks().then((books) => {
    setResult(books);
  });
  return (
    <div className="search-books-results">
      <ol className="books-grid">
        {result.map((book) => {
          <li></li>;
        })}
      </ol>
    </div>
  );
};

export default SearchResults;
